import "bootstrap/dist/css/bootstrap.min.css";
import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";
import { Link } from "react-router-dom";

const sectores = [
    { id: 1, nombre: "Tribuna Baja - Sector 1" },
    { id: 2, nombre: "Tribuna Baja - Sector 2" },
    { id: 3, nombre: "Tribuna Baja - Sector 3" },
    { id: 4, nombre: "Tribuna Media - Sector 1" },
    { id: 5, nombre: "Tribuna Media - Sector 2" },
    { id: 6, nombre: "Tribuna Media - Sector 3" },
    { id: 7, nombre: "Tribuna Alta - Sector 1" },
    { id: 8, nombre: "Tribuna Alta - Sector 2" },
    { id: 9, nombre: "Tribuna Alta - Sector 3" },
    { id: 10, nombre: "VIP - Sector 1" },
    { id: 11, nombre: "VIP - Sector 2" },
    { id: 12, nombre: "VIP - Sector 3" }
];

const Sectores = () => {
    return (
        <Container className="mt-4">
            <h2 className="text-center mb-4">Selecciona tu Sector</h2>
            <Row>
                {sectores.map((sector) => (
                    <Col key={sector.id} md={4} className="mb-3">
                        <Card className="text-center shadow-lg">
                            <Card.Body>
                                <Card.Title>{sector.nombre}</Card.Title>
                                <Link to={`/asientos3d/${sector.id}`} className="btn btn-primary">
                                    Ver en 3D
                                </Link>
                            </Card.Body>
                        </Card>
                    </Col>
                ))}
            </Row>
        </Container>
    );
};

export default Sectores;
